import React from 'react';
import style from './Category.module.css';
import Category_container from './Category_container';

function Category({textChanged}) {
  if (textChanged) {
    return null;
  }

  return (
    <div className={style.container}>
      <Category_container ><img src='/img/ABOUT.PNG'/></Category_container>
      <Category_container><img src='/img/CONTACT.PNG'/></Category_container>
      <Category_container><img src='/img/CREATERS.PNG'/></Category_container>
      <Category_container><img src='/img/MUSIC.PNG'/></Category_container>
      <Category_container><img src='/img/VISUALS.PNG'/></Category_container>
    </div>
  );
}


export default Category;
